import React from 'react';
import ReactDOM from 'react-dom/client';

const root = ReactDOM.createRoot(document.getElementById('root'));

function greet(first,last)
{
  return (
    <div>Hello {first}{last}</div>
  )
}

const element = <div>
  {greet()}
</div>



root.render(element);
